package Stacks;

import java.util.Stack;

public class Intor {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		Stack<Integer> st = new Stack<Integer>();
		st.push(12);
		st.push(34);
		System.out.println(st.pop());
		int temp = st.peek();
		System.out.println(temp);
		
		
	}

}
